import React from 'react';
import { Link } from "react-router-dom";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import './App.css';
import StoreModel from './model_more/model';
import HomeView from './site_pages/home.js';
import AboutMeView from './site_pages/aboutMe.js';
import ProductView from './site_pages/products.js';
import CvView from './site_pages/cv.js';
import LeatherView from './site_pages/leather.js';
import Header from './header_footer/header.js';
import Footer from './header_footer/footer.js';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.model = StoreModel;
    this.state = {};
  }

  render() {
    return (<Router>
          <React.Fragment>
            <Switch>

              <Route
                path="/"
                exact
                component={() => <HomeView model={this.model} />}
              />



              <Route
                path="/Products"
                exact
                component={() => <ProductView model={this.model} />}
              />




              <Route component={NoMatch} />

            </Switch>
          </React.Fragment>
          <Header/>
          <Footer/>
        </Router>

    );
  }
  //<Route path="/specPlaylist" render={() => <playlistSettings model={heroifyModel}/>}/>
}

const NoMatch = () => (
  <div className="outsideDiv">
    <div className="centered">
      <h1>404 No match</h1>
      <Link to="/">
        <h1>Click here to go to homepage</h1>
      </Link>
    </div>
  </div>
);

export default App;
